import React from 'react';
import ReactPlayer from 'react-player';
import './VideoQueue.css';
const VideoQueue = ( {videoNames, changeVideo} ) => {
	const state = {
		playing: 0,
		width: '168 px',
		height: '94 px',
		controls: false

	}
	const videoComp = (videoNames || []).map((user, i) => {
		return (
		<div className = 'playerContainer'  >
			<ReactPlayer 
		      	url = {videoNames[i]}
		      	width = {state.width}
		      	height= {state.height}
		      	playing = {state.playing}
		      	controls = {state.controls}
		      	onClick={changeVideo}
		      	/>
		      	<button onClick = {()=> {this.onDelete(videoNames[i])}}>Delete</button>
		</div>)
	})

	onDelete = (video) => {
		fetch("http://localhost:8000/delete", {
			method: 'post',
			headers: {'Content-Type': 'application/json'},
			body: JSON.stringify({
				link: video

		})}).then(function(res){
			console.log(res)
			console.log("Uploaded!")
		})
	}


	return(

		<div>
			{videoComp}
		</div>
	);
}

export default VideoQueue;
